import { Injectable } from '@angular/core';
import { Inmueble } from '../_modelo/inmueble';

@Injectable({
  providedIn: 'root'
})
export class InmuebleService {
  inmuebles: Inmueble[]=[
    {
      "referencia":"1",
      "descripcion":"piso chulo y caro" ,
      "img": "data:image/jpeg;base64,"
    },
    {
      "referencia":"2",
      "descripcion":"Casoplon bonito y barato",
      "img": "data:image/jpeg;base64,"

    },
    {
      "referencia":"3",
      "descripcion":"Casita sencilla",
      "img": "data:image/jpeg;base64,"
    }
  ]

  constructor() { }
  obtenerUno(referencia: string){
    return this.inmuebles.filter(elemento => elemento.referencia===referencia)[0];
  }
  obtenerTodos(){
    return this.inmuebles;
  }
}
